// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract VotingSystem {
    struct Candidate {
        uint id;
        string name;
        string party;
        string manifesto;
        uint voteCount;
    }

    struct Voter {
        bool isRegistered;
        bool hasVoted;
        uint vote; // Candidate ID
        string publicKey; // Quantum-safe public key (base64 encoded)
    }

    address public admin; // Admin account for managing the system
    uint public candidateCount; // Total number of candidates
    mapping(uint => Candidate) public candidates; // Candidate ID => Candidate details
    mapping(address => Voter) public voters; // Wallet address => Voter details
    mapping(uint => string) public auditTrail; // Candidate ID => Quantum-safe hash of votes

    event VoterRegistered(address voter, string publicKey);
    event CandidateRegistered(uint candidateId, string name, string party);
    event VoteCast(address voter, uint candidateId);
    event ResultsDeclared(uint candidateId, string name, uint voteCount);

    modifier onlyAdmin() {
        require(msg.sender == admin, "Only admin can perform this action");
        _;
    }

    constructor() {
        admin = msg.sender; // Set the deployer as the admin
    }

    // Register a voter with their quantum-safe public key
    function registerVoter(address _voter, string memory _publicKey) public onlyAdmin {
        require(!voters[_voter].isRegistered, "Voter already registered");
        voters[_voter] = Voter({
            isRegistered: true,
            hasVoted: false,
            vote: 0,
            publicKey: _publicKey
        });
        emit VoterRegistered(_voter, _publicKey);
    }

    // Register a candidate
    function registerCandidate(string memory _name, string memory _party, string memory _manifesto) public onlyAdmin {
        candidateCount++;
        candidates[candidateCount] = Candidate({
            id: candidateCount,
            name: _name,
            party: _party,
            manifesto: _manifesto,
            voteCount: 0
        });
        emit CandidateRegistered(candidateCount, _name, _party);
    }

    // Cast a vote
    function vote(uint _candidateId, string memory _quantumSafeHash) public {
        require(voters[msg.sender].isRegistered, "You are not registered to vote");
        require(!voters[msg.sender].hasVoted, "You have already voted");
        require(_candidateId > 0 && _candidateId <= candidateCount, "Invalid candidate ID");

        // Mark the voter as having voted
        voters[msg.sender].hasVoted = true;
        voters[msg.sender].vote = _candidateId;

        // Increment the vote count for the candidate
        candidates[_candidateId].voteCount++;

        // Store the quantum-safe hash in the audit trail
        auditTrail[_candidateId] = _quantumSafeHash;

        emit VoteCast(msg.sender, _candidateId);
    }

    // Get candidate details
    function getCandidateDetails(uint _candidateId)
        public
        view
        returns (
            string memory name,
            string memory party,
            string memory manifesto,
            uint voteCount
        )
    {
        require(_candidateId > 0 && _candidateId <= candidateCount, "Invalid candidate ID");
        Candidate memory candidate = candidates[_candidateId];
        return (candidate.name, candidate.party, candidate.manifesto, candidate.voteCount);
    }

    // Declare results for all candidates
    function declareResults() public onlyAdmin {
        for (uint i = 1; i <= candidateCount; i++) {
            Candidate memory candidate = candidates[i];
            emit ResultsDeclared(candidate.id, candidate.name, candidate.voteCount);
        }
    }

    // Get the quantum-safe hash of votes for a candidate
    function getAuditTrail(uint _candidateId) public view returns (string memory) {
        require(_candidateId > 0 && _candidateId <= candidateCount, "Invalid candidate ID");
        return auditTrail[_candidateId];
    }
}
